import React from "react";

const DetailAdress = (props) => {
  console.log(props);
  return (
    <div className="container">
      <div className="row">
        {props.adress.map((ad) => {
          return (
            <div>
              <h3>{ad.name}</h3>
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default DetailAdress;
